from datetime import datetime
import collections


class Solution:
    def updateMatrix(self, mat):
        # ans = mat.copy()
        m = len(mat)
        n = len(mat[0])
        global ans

        ans = [[0 if mat[i][j] == 0 else None for j in range(n)] for i in range(m)]
        count = 0
        hashmap = {}

        def fill_hashmap_from_mat(hashmap, mat, val):
            for i in range(len(mat)):
                for j in range(len(mat[0])):
                    if mat[i][j] == val:
                        if val in hashmap.keys():
                            hashmap[val].append([i,j])
                        else:
                            hashmap[val] = [[i,j]]


        def add_hashmap(hashmap, ind, val):
            if ind in hashmap.keys():
                hashmap[ind].append(val)
            else:
                hashmap[ind] = [val]


        def fill_near(hashmap, i, j, m, n, val):
            global ans
            if i + 1 < m and ans[i + 1][j] == None:
                ans[i + 1][j] = val
                add_hashmap(hashmap, val, [i+1, j])
            if i - 1 >= 0 and ans[i - 1][j] == None:
                ans[i - 1][j] = val
                add_hashmap(hashmap, val, [i-1, j])
            if j + 1 < n and ans[i][j + 1] == None:
                ans[i][j + 1] = val
                add_hashmap(hashmap, val, [i, j+1])
            if j - 1 >= 0 and ans[i][j - 1] == None:
                ans[i][j - 1] = val
                add_hashmap(hashmap, val, [i, j-1])


        fill_hashmap_from_mat(hashmap, mat, 0)

        step = 0
        while step in hashmap.keys():
            count = 0
            for coord in hashmap[step]:
                i = coord[0]
                j = coord[1]
                if ans[i][j] == step:
                    fill_near(hashmap, i, j, m, n, step + 1)
            step += 1

        return ans


